import React from 'react';
import 'tachyons';
import {Gal} from './galleryimg';

function Gallery() {
   const[gal,setgal]=useState(Gal);
    return (
        <section style={{overflow:'hidden'}}>

             <div className="flex flex-wrap mt4">


               <div>
               {
                  gal.map((data)=>{
                    <div>
                      <img src={data.image} />
                    </div>
                  })
                }
               </div>

              </div>

      </section>
      );
}

export default Gallery;

